import { NavLink } from 'react-router-dom';
import './App.css';

import React from 'react';

export const Nav = () => {
  return (
    <div className="App">
      <div className="container">
         <div className="nav">
          <h1>keshav</h1>
          <div className="navbar">
            <ul>
              <NavLink to="/about">About</NavLink>
              <NavLink>Projects</NavLink>
              <NavLink>Contacts</NavLink>
            </ul>
          </div>
         </div>
      </div>
    </div>
  );
}
